@sfjazz Join NPR Music 
 for their globe-trotting party this New Year's! Four worldly bands present grooving sounds from four locations around the world including the Grammy-nominated Ranky Tanky with vocal icon Ms. Lisa Fischer and their performance from the SFJAZZ Center in San Francisco recorded on November 4th, 2022. Many Gullah Geechee have their own New Year's tradition called Freedom's Eve Day. This broadcast also includes frequent SFJAZZ performers Chucho Valdés and Jose James. Listen in our LINKTREE

